import React from 'react'

const Navbar = () => {
  return (
    <nav className="nav bg-white dark:bg-black">
        <div className="m-0 p-4 justify-between text-black text-md">
            <ul>
                <li>Hello</li>
            </ul>
        </div>
    </nav>
  )
}

export default Navbar
